import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div className="home-page">
      <h1>Flashcard Study Site</h1>
      <p>Select an option from the navigation above or choose a flashcard set to review:</p>
      <ul>
        <li><Link to="/review/1">Review Flashcards</Link></li> {/* Example review link */}
      </ul>
    </div>
  );
};

export default HomePage;
